import React from 'react'
import './Portfolio.css'
import { swiper, swiperSlide } from 'swiper/react/swiper-react';
import BankApp from "../../img/BankApp.png";
import HotelApp from "../../img/HotelApp.png";
import NetfllixApp from "../../img/NetfllixApp.png";
import RemainderApp from "../../img/RemainderApp.png";
import todo from "../../img/todo.png";
import 'swiper/swiper-bundle.min.css'
import 'swiper/swiper.min.css'
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";





function Portfolio() {
  return (
    <div className="portfolio">

        {/* heading */}

        <span>Recent Projects</span>
        <span>Portfolio</span>

        {/* slider */}
        <swiper   spaceBetween={50}
      slidesPerView={3}
      centeredSlides
      onSlideChange={() => console.log("slide change")}
      onSwiper={swiper => console.log(swiper)}>

            <swiperSlide>
                <img src={NetfllixApp} alt="" />
            </swiperSlide>

            <swiperSlide>
                <img src={HotelApp} alt="" />
            </swiperSlide>

            <swiperSlide>
                <img src={todo} alt="" />
            </swiperSlide>

            <swiperSlide>
                <img src={RemainderApp} alt="" />
            </swiperSlide>

            <swiperSlide>
                <img src={BankApp} alt="" />
            </swiperSlide>
        </swiper>
    </div>
  )
}

export default Portfolio
